import React from 'react';
import Header from './components/ui/Header';

const Index = ({ title = 'Hello from next.js' }) =>
    <div>
        <Header color={'blue'} showFirstParagraph={true} />
        <h2>{title}</h2>
    </div>;

export default Index;
